var index_q0_res_freq = 0;
const readout_osc = 0;  // preliminary! will be updated by controller
configFreqSweep(readout_osc,-200000000.0,4000000.0);
waitZSyncTrigger();
playZero(160);
resetOscPhase();
repeat (16) {
  index_q0_res_freq = 0;
  playZero(176);
  setSweepStep(readout_osc,index_q0_res_freq++);
  playZero(36160);
  startQA(0,0,0,0,1);
  setTrigger(0);
  repeat (15) {
    playZero(131056);
  }
  repeat (100) {
    playZero(176);
    setSweepStep(readout_osc,index_q0_res_freq++);
    playZero(36160);
    startQA(0,0,0,0,1);
    setTrigger(0);
    repeat (15) {
      playZero(131056);
    }
  }
}
